import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './../Navbar.css';
import axios from 'axios';


export default class Navbar extends Component {

  eventoLogOut=()=>{
    localStorage.clear();
  }

  eventoAdmin=()=>{
    axios.get('http://localhost:5000/auth/authAdmin')
    .then(res=>{
      console.log(res);
      document.getElementById("sacarTurno").style.visibility="hidden";
      })
    .catch(e=>{console.log(e)});
    return false;
  }

  render() {
    let valor= false;
    return (
      <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
        <Link to="/" className="navbar-brand">Consultorio Medico</Link>
        <div className="collpase navbar-collapse">
        <ul className="navbar-nav mr-auto">
          <li className="navbar-item">
          <Link to="/turnos" className="nav-link">Turnos</Link>
          </li>
          <li className="navbar-item" id="sacarTurno">
          <Link to="/createTurno" className="nav-link" >Sacar turno</Link>
          </li>
          <li className="navbar-item">
          <Link to="/users" className="nav-link">Usuarios</Link>
          </li>
          <li className="navbar-item">
          <Link to="/createUser" className="nav-link">Crear usuario</Link>
          </li>
          <li className="navbar-item">
          <Link to="/recetas" className="nav-link">Recetas</Link>
          </li>
          <li className="navbar-item">
          <Link to="/createReceta" className="nav-link">Cargar Receta</Link>
          </li>
          <li className="navbar-item">
          <Link to="/historialList" className="nav-link">Historiales</Link>
          </li>
          <li className="navbar-item">
          <Link to="/crearHistorial" className="nav-link">Crear historial</Link>
          </li>
          <li className="navbar-item">
          <Link to="/" className="nav-link" onClick={this.eventoLogOut}>Salir</Link>
          </li>
        </ul>
        </div>
      </nav>
    );
  }
}
